import React, { useState } from "react";
import "./Table.css";
import Search from "./../Search";
import { useDispatch, useSelector } from "react-redux";
import { Link } from "react-router-dom";

import { setSearchTerm } from "./../../actions/filter";
/*

 */

const Table = ({ cities, filterby, FilterValue }) => {
  const dispatch = useDispatch();
  const srcsltct = useSelector((state) => state.visibilityFilter.searchValue);
  const [searchTerm, SetsearchTerm] = useState("");
  const data = cities.filter((data, index) => {
    if (searchTerm) {
      console.log(searchTerm, "^^^^^^^^");
    }
    return data;
  });
  const renderTable = data.map((city, i) => {
    return (
      <>
        <Link to="/restaurants">
          {" "}
          <tr key={i}>
            <td>{i + 1}</td>
            <td>{city.name}</td>
            <td>{city.code}</td>
            <td>{city.id}</td>
            <td>{city.city}</td>
            <td>{city.space_available}</td>
            <td>{city.type}</td>
            <td>{city.cluster}</td>
            <td>{city.is_registered ? "yes" : "no"}</td>
            <td>{city.is_live ? "yes" : "no"}</td>
          </tr>
        </Link>
      </>
    );
  });
  return (
    <>
      Search term: {srcsltct} <br />
      Filter:{FilterValue} <br />
      Filterby: {filterby}
      <Search
        value={searchTerm}
        onChange={(e) => {
          dispatch(setSearchTerm({ value: e.target.value }));
          console.log(e.target.value);
          SetsearchTerm(e.target.value);
        }}
      />
      <table>
        <thead>
          <tr>
            <th>S.no</th>
            <th>name</th>
            <th>code</th>
            <th>id</th>
            <th>city</th>
            <th>space_available</th>
            <th>type</th>
            <th>cluster</th>
            <th>is_registered</th>
            <th>is_live</th>
          </tr>
        </thead>
        <tbody>
          {data.length > 0 ? (
            <>{renderTable}</>
          ) : (
            <>
              <div>
                <h1>No Data Found</h1>
              </div>
            </>
          )}
        </tbody>
      </table>
    </>
  );
};

export default Table;
